import { Box, Container } from '@mui/system';
import React from 'react';
import Feed from './feed';
import Rightbar from './rightbar';
import Sidebar from './sidebar';

const Main = () => {
    return (
        <Box>
            <Sidebar/>
            <Feed/>
            <Rightbar/>
        </Box>
    )
}

export default Main;
